public double[][] getAlphaMatrix() {
    for (int i = 0; i < distanceMatrix.length; i++) {
        for (int j = 0; j < distanceMatrix.length; j++) {
            alphaMatrix[i][j] = -(1.0 / 2.0) * squareDistanceMatrix[i][j];
        }
    }
    return alphaMatrix;
}
